function analyzeWords(firstString, secondString) {

    var tokenSize = this.getTokenSize(firstString.length, secondString.length)

    var tokenizedFirst = this.tokenize(firstString, tokenSize)
    var tokenizedSecond = this.tokenize(secondString, tokenSize)

    var intersection = tokenizedFirst.intersect(tokenizedSecond)
    var union = tokenizedFirst.concat(tokenizedSecond).uniqueElements()

    this.showAllTokens(intersection, union)

    var similarity = intersection.length/union.length
    similarity = Math.round(similarity * 1000) / 1000
    var diceSimilarity = 2*intersection.length/(tokenizedFirst.length + tokenizedSecond.length)
    diceSimilarity = Math.round(diceSimilarity * 1000) / 1000

    this.get("JaccardDisplay").setTextString(similarity)
    this.get("DiceDisplay").setTextString(diceSimilarity)

    this.get("tokenizedFirst").reset()
    this.get("tokenizedFirst").initialize(tokenizedFirst)  
    this.get("tokenizedSecond").reset()
    this.get("tokenizedSecond").initialize(tokenizedSecond)

    this.get("forwardButton").setActive(true)
    this.get("backwardButton").setActive(true)   

    this.get("matchLight").setFill(Color.web.gray)
}

