function stepBack() {

    tokenizedFirst = this.get("tokenizedFirst")
    tokenizedSecond = this.get("tokenizedSecond")
    indexFirst = tokenizedFirst.currentIndex
    indexSecond = tokenizedSecond.currentIndex

    if (indexFirst == null){
        tokenizedFirst.highlight(tokenizedFirst.tokenizedString.length - 1)
        tokenizedSecond.highlight(tokenizedSecond.tokenizedString.length - 1)

    } else if ( indexFirst == 0 && indexSecond == 0){
        return

    } else if ( indexSecond == 0){
        tokenizedFirst.highlight(indexFirst - 1)
        tokenizedSecond.highlight(tokenizedSecond.tokenizedString.length - 1)

    } else {
        tokenizedSecond.highlight(indexSecond - 1)
        if ( indexFirst == 0 && indexSecond - 1 == 0){
            this.get("backwardButton").setActive(false)   
        }
    }

    if (!(indexFirst == 0 && indexSecond == 0)){
        this.get("forwardButton").setActive(true)
    }
    this.compareTokens(tokenizedFirst.tokenizedString[tokenizedFirst.currentIndex],
        tokenizedSecond.tokenizedString[tokenizedSecond.currentIndex])

}

