function stepForward() {

    var tokenizedFirst = this.get("tokenizedFirst")
    var tokenizedSecond = this.get("tokenizedSecond")
    var indexFirst = tokenizedFirst.currentIndex
    var indexSecond = tokenizedSecond.currentIndex

    if (indexFirst == null){
        tokenizedFirst.highlight(0)
        tokenizedSecond.highlight(0)

    } else if ( indexFirst >= tokenizedFirst.tokenizedString.length - 1
             && indexSecond >= tokenizedSecond.tokenizedString.length - 1){
        return

    } else if ( indexSecond >= tokenizedSecond.tokenizedString.length - 1){
        tokenizedFirst.highlight(indexFirst + 1)
        tokenizedSecond.highlight(0)

    } else {
        tokenizedSecond.highlight(indexSecond + 1)

        if ( indexFirst >= tokenizedFirst.tokenizedString.length - 1
             && indexSecond + 1 >= tokenizedSecond.tokenizedString.length - 1){
            this.get("forwardButton").setActive(false)
        }
    }


    if ( !(indexFirst >= tokenizedFirst.tokenizedString.length - 1
             && indexSecond >= tokenizedSecond.tokenizedString.length - 1)){
        this.get("backwardButton").setActive(true)       
    }


    this.compareTokens(tokenizedFirst.tokenizedString[tokenizedFirst.currentIndex],
        tokenizedSecond.tokenizedString[tokenizedSecond.currentIndex])

}

