function tokenize(string, tokenSize) {
    var tokenizedWord = []
    for (var i = 1; i <= tokenSize - 1; i++)
        tokenizedWord.push((new Array(tokenSize - i + 1)).join("_") + string.slice(0, i))

    for (var i = 0; i <= string.length - tokenSize; i++)
        tokenizedWord.push(string.slice(i, i + tokenSize))

    for (var i = 1; i <= tokenSize - 1; i++)
        tokenizedWord.push(string.slice(string.length - tokenSize + i, string.length) + (new Array(i+1)).join("_"))

    return tokenizedWord
}

