function analyzeWords(firstString, secondString) {

    this.reset()

    this.firstWord = firstString
    this.secondWord = secondString

    this.showFirstWord()
    this.showSecondWord()

    this.initializeMatrix(this.firstWord.length, this.secondWord.length)

    for(var i = 1; i<this.similarityMatrix.length; i++)
    {
        for(var j = 1; j<this.similarityMatrix[0].length; j++)
        {
            this.fillCellAt(i,j)
        }
    }
    this.hideAllValues()

    var maxLength = Math.max(this.firstWord.length, this.secondWord.length)
    var distance = this.similarityMatrix[this.firstWord.length][this.secondWord.length].getValue()

    var similarity = 1 - (distance/maxLength)
    similarity = Math.round(similarity * 1000) / 1000

    this.get("LevenshteinDisplay").setTextString(similarity)

}

