    this.textBoxesToDelete = []
    this.evolutionArray = []

    this.stepCounter = 0
    this.showAllValues()

    var x = this.matrixIndexX
    var y = this.matrixIndexY

    while(!(x == 0 && y == 0)){
        this.showArrow(x, y)
        var origin = this.similarityMatrix[x][y].getOrigin()

        if (origin == "northWest"){
            x--
            y--
        } else if (origin == "north"){
            y--
        } else {
            x--
        }
        this.stepCounter++
    }
    this.showEvolutionArray()
}

