function determineCurrentCell(nextCell) {
    var currentCell = new Object()

    //determine currentCell
    if (nextCell.origin == "northWest"){
        currentCell.x = nextCell.x-1
        currentCell.y = nextCell.y-1

    } else if (nextCell.origin == "north"){
        currentCell.x = nextCell.x
        currentCell.y = nextCell.y-1

    } else {
