function showArrow(x,y) {

    var currentCell = this.similarityMatrix[x][y]
    var origin = currentCell.getOrigin()
    var arrow = null 

    if (origin == "west"){
        arrow = this.createRedArrow()
        this.addMorph(arrow)
        arrow.setPosition(pt(currentCell.getPosition().x, currentCell.getCenter().y+8))
    } else if (origin == "north"){
        arrow = this.createGreenArrow()
        this.addMorph(arrow)
        arrow.setPosition(pt(currentCell.getCenter().x+8, currentCell.getPosition().y))
    } else if (origin == "northWest"){

        if(this.firstWord[x-1] == this.secondWord[y-1]){
            arrow = this.createArrow()        
        } else {
            arrow = this.createBlueArrow()            
        }
        this.addMorph(arrow)
        arrow.setPosition(currentCell.getPosition())
    }

    if (arrow != null) {
        this.arrowsToDelete.push(arrow)
    }
}

