1353.source:
function fillCellAt(x,y) {
    var transpositionCost = 1

    var north = this.similarityMatrix[x][y-1].getValue()+1
    var west = this.similarityMatrix[x-1][y].getValue()+1
    var northWest = this.similarityMatrix[x-1][y-1].getValue()+1
    if (x >= 2 &&
        y >= 2 &&
        this.firstWord[x-1] == this.secondWord[y-2] &&
        this.firstWord[x-2] == this.secondWord[y-1]){
        var northWestTransposition = this.similarityMatrix[x-2][y-2].getValue()+transpositionCost
        if(this.firstWord[x-1] == this.secondWord[y-1]){
            northWest = northWest-1
        }
        var value = Math.min(north, west, northWest, northWestTransposition)
    } else {
        if(this.firstWord[x-1] == this.secondWord[y-1]){
            northWest = northWest-1
        }
        var value = Math.min(north, west, northWest)
    }

    var origin = ""

    if (value == northWest){
        origin = "northWest"
    } else if (value == north){
        origin = "north"
    } else if (value == west){
        origin = "west"
    } else {
        origin = "northWestTransposition"
    }

    this.similarityMatrix[x][y] = this.createCell(x,y, value, origin)
}

