function initializeMatrix(firstLength, secondLength) {
    var matrix = new Array(firstLength + 1)

    for (var i = 0; i<matrix.length; i++)
    {
        matrix[i] = new Array(secondLength + 1)
    }
    var origin = ""
    for (var i = 0; i<matrix.length; i++)
    {
        if(i==0){
            origin = ""
        } else {
            origin = "west"
        }
        matrix[i][0] = this.createCell(i,0,i, origin)
    }

    for (var i = 0; i<secondLength+1; i++)
    {
