function calculateSimilarities() {

    var firstString = this.get("firstStringText").getTextString().replace(/ /g,"˽")
    var secondString = this.get("secondStringText").getTextString().replace(/ /g,"˽")

    if (this.get("caseSensitivityCheck").checked){
        firstString = firstString.toUpperCase()
        secondString = secondString.toUpperCase()
    }

    //for new words clear the old similarity results
    if (this.latestFirstString != firstString || 
        this.latestSecondString != secondString){
        this.get("LevenshteinDisplay").setTextString("")
        this.get("JaccardDisplay").setTextString("")
        this.get("DamerauDisplay").setTextString("")
        this.get("DiceDisplay").setTextString("")

        this.latestFirstString = firstString
        this.latestSecondString = secondString
    }


    if (this.activatedPane == "Jaccard"){
        this.get("Jaccard - Pane").analyzeWords(firstString, secondString) 
    } else if (this.activatedPane == "Levenshtein"){    
        this.get("Levenshtein - Pane").analyzeWords(firstString, secondString)
    } else if (this.activatedPane == "Damerau"){    
        this.get("Damerau - Pane").analyzeWords(firstString, secondString)
    }
}
